import React from "react";
import { MenuList } from "../data/data";
import Layout from "./../components/Layout/Layout";
import {
  Box,
  Card,
  CardActionArea,
  CardContent,
  CardMedia,
  Typography,
} from "@mui/material";


import { useEffect, useState } from "react";
//import "./App.css";

function Menu() {
  const [jsonData, setJsonData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetch('http://127.0.0.1:8000/')
      .then(response => response.json())
      .then(data => {
        setJsonData(data);
        setLoading(false);
      })
      .catch(error => {
        setError(error);
        setLoading(false);
      });
  }, []);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error.message}</div>;
  }

  return (
    <div>
    <table border="1">
    <tr>
    <th>Id</th>
          <th>Category</th>
          <th>Item Name</th>
          <th>Item Type</th>
          <th>Quantity</th>
          <th>Price</th>
          <th>Image</th>
          <th>Ratings</th>
    </tr>
      {jsonData && (
        <ul>
          {jsonData.map(item => (
            <tr>
            <td>{item.id}</td>
            <td>{item.category}</td>
            <td>{item.item_name}</td>
            <td>{item.item_type}</td>
            <td>{item.quantity}</td>
            <td>{item.price}</td>
            <td>
              <img src={'http://localhost:3000/images/'+item.item_image} alt="" height={100} />
            </td>
            <td>{item.rating}</td>


            </tr>

          ))}
        </ul>
      )}
      </table>
    </div>
  );
}

export default Menu;
